import React, { useEffect } from 'react';
import clsx from 'clsx';
import { makeStyles, createMuiTheme } from '@material-ui/core/styles';
import CssBaseline from '@material-ui/core/CssBaseline';
import Drawer from '@material-ui/core/Drawer';
import Box from '@material-ui/core/Box';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import List from '@material-ui/core/List';
import Typography from '@material-ui/core/Typography';
import Divider from '@material-ui/core/Divider';
import IconButton from '@material-ui/core/IconButton';
import Badge from '@material-ui/core/Badge';
import Container from '@material-ui/core/Container';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import Link from '@material-ui/core/Link';
import MenuIcon from '@material-ui/icons/Menu';
import {ThemeProvider} from '@material-ui/core/styles'
import ChevronLeftIcon from '@material-ui/icons/ChevronLeft';
import { mainListItems, secondaryListItems } from './dashboardElements/listItems';
import UnregisteredFeed from './dashboardElements/unregisteredFeed'
import Emergency from './dashboardElements/emergency'
import SchoolHeader from './dashboardElements/schoolHeader'
import UserRegister from '../registerNewPlate/registerUser'
import PlateFeed from '../activePlatesFeed/searchTable'
import ConfigFeed from '../configuration/configuration'
import CamFeed from '../cameraFeed/cameraLayout'
import DailyFeed from '../dailyActivity/activityLayout'
import UnrecongizedLayout from '../unrecognizedActivity/unrecognizedDashboard'
import Button from '@material-ui/core/Button'

const Axios = require('axios')
const sendFeed = require('../dashboard/sendFeed')
const logo = require('../../assets/images/logo0.svg')

function Copyright() {
  return (
    <Typography variant="body2" color="textSecondary" align="center">
      {'Copyright Â© '}
      <Link color="inherit" href="https://material-ui.com/">
        SecureVision
      </Link>{' '}
      {new Date().getFullYear()}
      {'.'}
    </Typography>
  );
}

// global test for adding unregustered plate
setInterval(() => {
  console.log("Adding an unregistered plate")
  Axios.post('/api/lpr/addUnrecognized', {
    plateNumber: '989898',
    location: 'Front Entrance'
  }
)
}, 5000)

const drawerWidth = 240;

const useStyles = makeStyles(theme => ({
  root: {
    display: 'flex',
    zIndex: '1'
  },
  toolbar: {
    paddingRight: 24, // keep right padding when drawer closed
  },
  toolbarIcon: {
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'flex-end',
    padding: '0 8px',
    ...theme.mixins.toolbar,
  },
  appBar: {
    backgroundColor: '#E5E5E5',
    color: '#110052',
    zIndex: theme.zIndex.drawer + 1,
    transition: theme.transitions.create(['width', 'margin'], {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.leavingScreen,
    }),
  },
  appBarShift: {
    marginLeft: drawerWidth,
    width: `calc(100% - ${drawerWidth}px)`,
    transition: theme.transitions.create(['width', 'margin'], {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.enteringScreen,
    }),
  },
  menuButton: {
    marginRight: 36,
  },
  menuButtonHidden: {
    display: 'none',
  },
  title: {
    flexGrow: 1,
  },
  drawerPaper: {
    backgroundColor: '#E5E5E5',
    position: 'relative',
    whiteSpace: 'nowrap',
    width: drawerWidth,
    transition: theme.transitions.create('width', {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.enteringScreen,
    }),
  },
  drawerPaperClose: {
    overflowX: 'hidden',
    transition: theme.transitions.create('width', {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.leavingScreen,
    }),
    width: theme.spacing(7),
    [theme.breakpoints.up('sm')]: {
      width: theme.spacing(9),
    },
  },
  appBarSpacer: theme.mixins.toolbar,
  content: {
    flexGrow: 1,
    height: '100vh',
    overflow: 'auto',
    backgroundColor: '#E5E5E5'
  },
  container: {
    paddingTop: theme.spacing(4),
    paddingBottom: theme.spacing(4),
    backgroundColor: '#E5E5E5'
  },
  paper: {
    padding: theme.spacing(2),
    display: 'flex',
    overflow: 'auto',
    flexDirection: 'column',
    color: '#110052',
    backgroundColor: '#E5E5E5'
  },
  fixedHeight: {
    height: 240,
    backgroundColor: '#E5E5E5'
  },
}));

export default function Dashboard(props) {

  sendFeed()

  const registerLogout = () => {
    let logout = Axios.get('/api/auth/logout')
    console.log(logout)
    props.history.push('/')
  }

  let currPath = props.location.pathname

  const classes = useStyles();
  const [open, setOpen] = React.useState(true);
  const handleDrawerOpen = () => {
    setOpen(true);
  };
  const handleDrawerClose = () => {
    setOpen(false);
  };
  const fixedHeightPaper = clsx(classes.paper, classes.fixedHeight);

  let feedToShow

  let defaultFeed = (
    <Container maxWidth="lg" className={classes.container}>
          <Grid container spacing={3}>
            {/* div area */}
            <Grid item xs={12} md={8} lg={9}>
              <Paper className={fixedHeightPaper}>
                <SchoolHeader 
                  school="Boston College"
                  location="Chestnut Hill, MA"
                  />
              </Paper>
            </Grid>
            {/* Recent Deposits */}
            <Grid item xs={12} md={4} lg={3}>
              <Paper className={fixedHeightPaper}>
                {<Emergency />}
              </Paper>
            </Grid>
            {/* Recent Orders */}
            <Grid item xs={12}>
              <Paper className={classes.paper}>
                {<UnregisteredFeed />}
              </Paper>
            </Grid>
          </Grid>
          <Box pt={4}>
            <Copyright />
          </Box>
        </Container>
  )

  let dailyFeed = (
    <Container maxWidth="lg" className={classes.container}>
      <DailyFeed/>
    </Container>
  )

  let unrecognizedFeed = (
    <Container maxWidth="lg" className={classes.container}>
      <UnrecongizedLayout/>
    </Container>
  )

  let cameraFeed = (
    <Container maxWidth="lg" className={classes.container}>
      <CamFeed />
    </Container>
  )

  let newUserFeed = (
    <Container maxWidth="lg" className={classes.container}>
      <UserRegister></UserRegister>
    </Container>
  )

  let plateFeed = (
    <Container maxWidth="lg" className={classes.container}>
      <PlateFeed />
    </Container>
  )

  let configFeed = (
    <Container maxWidth="lg" className={classes.container}>
      <ConfigFeed />
    </Container>
  )

  switch(currPath){
    case '/dashboard/activity':
      feedToShow = dailyFeed
      break
    case '/dashboard/unrecognized':
      feedToShow =  unrecognizedFeed
      break
    case '/dashboard/cameras':
      feedToShow = cameraFeed
      break 
    case '/dashboard/registerNewUser':
      feedToShow =  newUserFeed
      break 
    case '/dashboard/plates':
      feedToShow = plateFeed
      break
    case '/dashboard/configuration':
      feedToShow = configFeed
      break
    default:
      feedToShow = defaultFeed
      break 
  }

  let theme = createMuiTheme({
    palette: {
      type: 'dark'
    }
  })

  return (
    <div className={classes.root}>
      <CssBaseline />
      <AppBar position="absolute" className={clsx(classes.appBar, open && classes.appBarShift)}>
        <Toolbar className={classes.toolbar}>
          <IconButton
            edge="start"
            color="inherit"
            aria-label="open drawer"
            onClick={handleDrawerOpen}
            className={clsx(classes.menuButton, open && classes.menuButtonHidden)}
          >
            <MenuIcon />
          </IconButton>
          <Typography component="h1" variant="h6" color="inherit" noWrap className={classes.title}>
            <img src={logo} style={{height: '45px', width: 'auto', marginTop: '10px'}}></img>
          </Typography>
          <Button style={{marginRight: '30px'}}>
            Report a Problem
          </Button>
          <Button color="inherit" onClick = {registerLogout}>
            Logout
          </Button>
        </Toolbar>
      </AppBar>
      <Drawer
        variant="permanent"
        classes={{
          paper: clsx(classes.drawerPaper, !open && classes.drawerPaperClose),
        }}
        open={open}
      >
        <div className={classes.toolbarIcon}>
          <IconButton onClick={handleDrawerClose}>
            <ChevronLeftIcon />
          </IconButton>
        </div>
        <Divider />
        <List>{mainListItems}</List>
        <Divider />
        <List>{secondaryListItems}</List>
        {/* <Emergency/> */}
      </Drawer>
      <main className={classes.content}>
        <div className={classes.appBarSpacer} />
        {feedToShow}
      </main>
    </div>
  );
}
